DROP TABLE public.covid_19_new_zealand;

CREATE TABLE public.covid_19_new_zealand (
	id SERIAL PRIMARY KEY,
	"class" varchar(6) NULL,
	category varchar(8) NULL,
	indicator_name varchar(15) NULL,
	series_name varchar(24) NULL,
	sub_series_name varchar(24) NULL,
	"parameter" date NULL,
	value int4 NULL,
	units varchar(6) NULL,
	date_last_updated date NULL
);
CREATE INDEX covid_19_new_zealand_parameter_idx ON public.covid_19_new_zealand USING btree (parameter);

